import React, { Component } from 'react';

class MenuComponent extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div className="col-md-6 col-md-offset-100">
                <button>Список студентов</button>
                <button>Список групп</button>
                <button></button>
            </div>
        );
    }
}


export default MenuComponent;
